import React from 'react';

function App() {
  return (
    <div style={{ padding: '50px', textAlign: 'center', fontFamily: 'Arial' }}>
      <h1>My Portfolio Website</h1>
      <p>Website is building...</p>
      <button onClick={() => alert('Website chal gaya!')}>
        Test Button
      </button>
    </div>
  );
}

export default App;
